// questions.js
const questions = [
    {
      question: 'What genres of music do you enjoy?',
      options: ['Pop', 'Rock', 'Jazz', 'Classical', 'Hip-hop', 'Electronic'],
    },
    {
      question: 'How do you usually discover new music?',
      options: ['Radio', 'Friends', 'Social Media', 'Music Streaming Services', 'Other'],
    },
    {
      question: 'Which music streaming services do you use?',
      options: ['Spotify', 'Apple Music', 'YouTube Music', 'Amazon Music', 'Other'],
    },
    {
      question: 'How often do you attend live music events?',
      options: ['Frequently', 'Occasionally', 'Rarely', 'Never'],
    },
    {
      question: 'Who is your favorite artist or band?',
      options: ['Artist 1', 'Artist 2', 'Artist 3', 'Artist 4', 'Artist 5'],
    },
  ];

  export default questions;
